-- Users
CREATE TABLE IF NOT EXISTS users (
    userid SERIAL PRIMARY KEY,
    name VARCHAR NOT NULL,
    email VARCHAR UNIQUE NOT NULL,
    passwordhash VARCHAR NOT NULL,
    roleid INT NULL,
    managerid INT NULL,
    departmentid INT NULL,
    createdat TIMESTAMPTZ NULL,
    updatedat TIMESTAMPTZ NULL,
    status VARCHAR NULL,
    lastlogin TIMESTAMPTZ NULL,

    -- Indexes
    CONSTRAINT uq_users_email UNIQUE (email),
    CONSTRAINT fk_users_role FOREIGN KEY (roleid)
        REFERENCES roles (roleid)
        ON DELETE SET NULL
        ON UPDATE CASCADE,
    CONSTRAINT fk_users_manager FOREIGN KEY (managerid)
        REFERENCES users (userid)
        ON DELETE SET NULL
        ON UPDATE CASCADE,
    CONSTRAINT fk_users_department FOREIGN KEY (departmentid)
        REFERENCES departments (departmentid)
        ON DELETE SET NULL
        ON UPDATE CASCADE
);
CREATE INDEX IF NOT EXISTS idx_users_managerid ON users (managerid);
CREATE INDEX IF NOT EXISTS idx_users_departmentid ON users (departmentid);
CREATE INDEX IF NOT EXISTS idx_users_roleid ON users (roleid);


